import React from 'react'
import InsideModifier from './insideModifier'

export default function ModifierView() {


  const Modules=[
    {title: 'Presets' },
    {title:'Generator'},
    {title: 'Volume'},
    {title: 'Vibrato'},
    {title: 'Filter'},
    {title:'Phaser'},
    {title: 'Envelope'},
    {title: 'Delay'}
  ];


  return (
    <div className='ModifierView'>
      <center>
        <table>
          {[0,1,2,3].map(rowIndex => (
            <tr key={rowIndex}>
              {[0,1].map(cellIndex => {
                const modulesIndex = rowIndex*2+cellIndex;
                const title = Modules.title[modulesIndex];
                return(
                  <td key = {cellIndex} style={{marginLeft: 30, marginRight:30}}>
                    <InsideModifier title={title}/>
                  </td>
                );
              })}
            </tr>
          ))}
        </table>
      </center>
    </div>
  )
}
